import React from "react";

const Registrations = props => {
  return (
    <div className="form-group">
      <label for={props.name}> {props.title} </label>
      
        //value={props.value}
        {props.value.map(arr => {
        return arr.map(a => {
          return <p>{a}</p>
        })
      })}
      
    </div>
  );
};

export default Registrations;
